import React from 'react'
import { View, Text } from 'react-native'
import Icon from 'react-native-vector-icons/AntDesign';
import tw from "twrnc";

export default function AppbarMessages() {
    return (
        <View style={tw`flex-row items-center pt-[20px] pb-[15px] px-[13px]`}>
            <Icon name="arrowleft" size={30} style={tw`mr-[30px]`}/>
            <Text>abhilasha_4sq</Text>
            <Icon name="down" size={30} style={tw`mr-[30px]`}/>
        </View>
    )
}
